pragma solidity ^0.4.0;
pragma experimental ABIEncoderV2;
contract DrugTracer {

    //------------------------

    //
    struct ProduceDetail {
        string  drug;           //
        bool    state;          //
        address producerCode;   //
        string  produceDate;    //
        uint    volume;         //
        uint    left;           //
        bool    isValid;
    }

    //
    mapping (string => ProduceDetail) produceList;

    //
    struct InflowDetail {
        string  drugCode;   //
        uint    volume;     //
        address toMerchant; //
        uint    left;       //
        bool    isValid;
    }

    //
    mapping (string => InflowDetail) inflowList;

    //
    mapping (address => string[]) simpleInflowList;

    //---------------------------

    //
    struct RollDetail {
        string  inflowNumber;   //
        string  circulateDate;  //
        uint    volume;         //
        address toDrugstore;    //
        uint    left;           //
        bool    isValid;
    }

    //
    mapping (string=>RollDetail) rollList;

    //
    mapping (address=>string[]) simpleRollList;

    //-------------------------

    //
    struct SaleDetail {
        string  circulateNumber;    //
        address customerNumber;     //
        uint    volume;             //
        string  saleDate;           //
        bool    isValid;
    }

    //
    mapping (string=>SaleDetail) saleList;

    //
    mapping (address=>string[]) simpleSaleList;

    //---------------------------

    //
    struct ReportDetail {
        string  saleNumber; //
        string  reportDate; //
        address reporter;   //
        string  report;     //
        bool    state;      //
        bool    isValid;
    }

    //
    mapping (string=>ReportDetail) reportList;

    //
    mapping (address=>string[]) simpleReportList;

    //-------------------------

    //
    struct DealDetail {
        string  dealDate;   //
        bool    result;     //
        bool    isValid;
    }

    //
    mapping (string=>DealDetail) dealList;

    //
    string[] reports;

    //------set--------------------

    //statetrue
    //drugCode:
    //drug:
    //producer:
    //produceDate:
    //volume:
    //return:truefalse
    function setProduce (
                        string drugCode,
                        string drug,
                        address producer,
                        string produceDate,
                        uint volume)
                        public returns (bool) {
        ProduceDetail memory drugInfo = ProduceDetail(drug, true, producer, produceDate, volume, volume, true);
        if (produceList[drugCode].isValid == false) {
            produceList[drugCode] = drugInfo;
            return true;
        }
        else {
            return false;
        }
    }

    //hash
    //number:
    //drugCode:
    //volume:
    //toMerchant:
    //return:truefalse
    function setInflow (
                        string number,
                        string drugCode,
                        uint volume,
                        address toMerchant)
                        public returns (bool) {
        InflowDetail memory inflowInfo = InflowDetail(drugCode, volume, toMerchant, volume, true);//
        if (inflowList[number].isValid == false && produceList[drugCode].left >= volume) {
            inflowList[number] = inflowInfo;
            produceList[drugCode].left -= volume;
            setSimpleInflow(toMerchant, number);
            return true;
        }
        else {
            return false;
        }
    }

    //
    //to:
    //number:
    function setSimpleInflow (
                                address to,
                                string number)
                                internal {
        simpleInflowList[to].push(number);
    }

    //------set---------------------

    //hash
    //number:
    //inflowNumber:
    //circulateDate:
    //volume:
    //toDrugStore:
    //return:
    function setRoll (
                        string number,
                        string inflowNumber,
                        string circulateDate,
                        uint volume,
                        address toDrugStore)
                        public returns (bool) {
        RollDetail memory rollInfo = RollDetail(inflowNumber, circulateDate, volume, toDrugStore, volume, true);
        if (rollList[number].isValid == false && inflowList[inflowNumber].left >= volume) {
            rollList[number] = rollInfo;
            inflowList[inflowNumber].left -= volume;
            setSimpleRoll(toDrugStore, number);
            return true;
        }
        else {
            return false;
        }
    }

    //
    //to:
    //number:
    function setSimpleRoll (
                            address to,
                            string number)
                            internal {
        simpleRollList[to].push(number);
    }

    //------set-----------------------

    //hash
    //number:
    //circulateNumber:
    //customerNumber:
    //volume:
    //saleDate:
    //return:truefalse
    function setSale (
                        string number,
                        string circulateNumber,
                        address customerNumber,
                        uint volume,
                        string saleDate)
                        public returns (bool) {
        SaleDetail memory saleInfo = SaleDetail(circulateNumber, customerNumber, volume, saleDate, true);
        if (saleList[number].isValid == false && rollList[circulateNumber].left >= volume) {
            saleList[number] = saleInfo;
            rollList[circulateNumber].left -= volume;
            setSimpleSale(customerNumber, number);
            return true;
        }
        else {
            return false;
        }
    }

    //
    //to:
    //number:
    function setSimpleSale(
                            address to,
                            string number)
                            internal {
        simpleSaleList[to].push(number);
    }

    //------set------------------------

    //hashfalse
    //number:
    //saleNumber:
    //reportDate:
    //report:
    //state:falsetrue
    //return:truefalse
    function setReport (
                        string number,
                        string saleNumber,
                        string reportDate,
                        address reporter,
                        string report,
                        bool state)
                        public returns (bool) {
        ReportDetail memory reportInfo = ReportDetail(saleNumber, reportDate, reporter, report, false, true);
        if (reportList[number].isValid == false) {
            reportList[number] = reportInfo;
            setSimpleReport(reporter, number);
            return true;
        }
        else {
            return false;
        }
    }

    //
    //to:
    //number:
    function setSimpleReport (
                                address to,
                                string number)
                                internal {
        simpleReportList[to].push(number);
    }

    //------set----------------------------

    //true
    //number:
    //dealDate:
    //result:
    //return:truefalse
    function setDeal (
                        string number,
                        string dealDate,
                        string drugCode,
                        bool result)
                        public returns (bool) {
        DealDetail memory dealInfo = DealDetail(dealDate, result, true);
        if (dealList[number].isValid == false) {
            reportList[number].state = true;
            dealList[number] = dealInfo;
            if (result == true) {
                //
                produceList[drugCode].state = false;
            }
           return true;
        }
        else {
            return false;
        }
    }

